import { makeStyles } from '@material-ui/core/styles';


export default makeStyles(() => ({
    paper: {
        margin: "10px",
        background: '#0021A5',
        color: 'blue'
    },
    grid: {
        margin: '10px',
        padding: '10px'
    },
    title: {
        margin: '10px',
        padding: '10px'
    },
    description: {
        margin: '10px',
        padding: '10px'
    },
    time: {
        margin: '10px',
        padding: '10px'
    },
}));
